// SPDX-License-Identifier: GPL-3.0

pragma solidity 0.8.14;

import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/access/Ownable.sol";


contract Voting is Ownable {

    uint winningProposalId;

    struct Voter {
        bool isRegistered;
        bool hasVoted;
        uint256 votedProposalId;
    }

    struct Proposal {
        string description;
        uint256 voteCount;
    }

    // on link l'addresse des votants au struct Voter, chaque votant aura alors
    // - est ce qu'il est enregistré
    // - a t il voté
    // - Pour quel projet a t il voté

    mapping(address => Voter) public voters;
    Voter[] public votersArray;


    // on link l'addresse des proposés au struct Proposal, chaque proposé aura alors
    mapping(address => Proposal) public proposals;
    Proposal[] public proposalsArray;

    // on link l'addresse des Voter au struct Proposal, chaque proposé aura alors

    // on stock les propositions dans un array
   
    enum WorkflowStatus {
        RegisteringVoters,
        ProposalsRegistrationStarted,
        ProposalsRegistrationEnded,
        VotingSessionStarted,
        VotingSessionEnded,
        VotesTallied
    }

    // on utilise enum comme une variable d'état
    WorkflowStatus public workflowStatus;


    // On déclare les events qui vont être trigger
    event VoterRegistered(address voterAddress);
    event WorkflowStatusChange(
        WorkflowStatus previousStatus,
        WorkflowStatus newStatus
    );
    event ProposalRegistered(uint256 proposalId);
    event Voted(address voter, uint256 proposalId);


    // on met en place un modifier pour limiter les votes et proposition au voter enregistré
    modifier onlyRegisteredVoters {
        require(voters[msg.sender].isRegistered);
        _;
    }


    // l'admin enregistre les votants dans la whitelist
    function addWhitelist(address _voterAddress) public onlyOwner {

        // on verifie que l'admin a bien ouvert la session d'enregistrement des votants
        require(workflowStatus == WorkflowStatus.RegisteringVoters, "les votes ne sont pas encore ouverts" );

        // on regarde si l'addresse du votant est déjà enregistré
        require(!voters[_voterAddress].isRegistered, "Vous etes deja enregistre");

        // on passe le votant enregistrer en true pour indiquer qu'il est enregistré
        voters[_voterAddress].isRegistered = true;

        // on declenche l'event pour inquer qu'il est bien enregistré
        emit VoterRegistered(_voterAddress);
        
    }


    function registerVoterCanPropose() public onlyRegisteredVoters {

    }


    function getWinner() public view returns(uint){
        return winningProposalId;
        
    }

    
    
}

